import './App.css';
import persons from './data/persons';
import Person from './components/Person'

function App() {
	return (
		<div className="App">
			{persons.map((person) => {
				const [id, firstName, lastName, img, email] = person
				return <Person
					id={person.id}
					lastName={lastName}
					firstName={firstName}
					img={person.img}
					email={person.email}
				/>
			})}
		</div>
	);
}

export default App;
